import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class Newsletter extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div
          style={{
            position: "fixed",
            top: "50%",
            left: "50%",
            marginTop: -50,
            marginLeft: -100,
          }}
        >
          <div style={{ backgroundColor: "black" }}>Join my newsletter</div>
          <a href="#">
            <div>Join here</div>
          </a>
        </div>
      </div>
    );
  }
}

export default Newsletter;
